import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import { isAuthenticated } from './utils/authUtils';

const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route
      {...rest}
      render={(props) =>
        isAuthenticated() ? (
          <Component {...props} />
        ) : (
          <Redirect to="/" />
        )
      }
    />
  );
  
  export default PrivateRoute;
